import React from 'react';
import { Box, Button } from '@material-ui/core'
import { Formik, Form, FormikHelpers } from "formik"
import FormField from '../components/Form/FromField'
import { connect } from 'react-redux'
import { register } from '../modules/auth/authOperations'

type AddBankFormType = {
    handleSubmit: (values: any, actions: FormikHelpers<any>) => any
    setIsAddBank: (isOk: boolean) => void
    register: any
    isLoading: boolean
  };
const Register: React.FC<AddBankFormType>  = ({ register, isLoading }) => {
    return (
        <Box display="flex" justifyContent="center" alignItems="center" height="100vh">
            <Box width={500} height={400}   bgcolor="green" borderRadius="30px" display="flex"  justifyContent="center" alignItems="center" >
            <Formik
                initialValues={{
                    boundaties: "",
                    amount: null
                }}
                onSubmit={async (values, actions) => {
                    const res = await register(values)
                    console.log('REsult', res)

                }}
            >   
                {(props) => (
                <Form>
                    <Box>
                        <FormField
                            {...props}
                            name="boundaties"
                            placeholder="bank name"
                            label="bank name"
                        />
                    </Box>

                    <FormField
                        {...props}
                        name="boundaties"
                        placeholder="bank name"
                        label="bank name"
                    />
                </Form>
                )}
                <Button type="submit">
                    Register
                </Button> 
            </Formik>
            </Box>
        </Box>
    );
}

const mapStateToProps = (state) => {
    return {
      isLoading: state.authReducer.isLoading,
    };
  };

const mapDispatchToProps = {
    register
}

export default  connect (mapStateToProps, mapDispatchToProps)(Register) ;
